import React, {Component} from 'react';
import {Navbar, NavbarBrand, NavItem, NavLink, Nav, Col, Row, Container, Input, Table, Button, ButtonGroup, Media} from 'reactstrap';
import Linkify from 'react-linkify';

import ReactTable from "react-table";
import 'react-table/react-table.css'

export default class MainPage extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            activeTab: '1'
        };
    }

    toggle(tab) {
        if (this.state.activeTab !== tab) {
            this.setState({
                activeTab: tab
            });
        }
    }


    render() {
        return (
            <div>
                <Navbar color="light" light expand="md">
                    <NavbarBrand style={{marginLeft: '10px'}} class="logo" href="#">CV Management</NavbarBrand>
                    <Nav className="ml-auto" navbar>
                        <NavItem>
                            <NavLink href="#">Profile</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="#">Logout</NavLink>
                        </NavItem>
                    </Nav>
                </Navbar>

                <center>
                    <h1 style={{marginTop: '40px'}}>Profile</h1>
                </center>

                <Container name="mainPage" style={{backgroundColor: 'white', minHeight: '700px', marginTop: '30px', boxShadow: '5px 5px #c9cacc'}}>  
                    <Row>
                        <Col xs="6">
                            <img width="300px" src={'https://bit.ly/2Fvw9xi'} style={{paddingTop: '50px', paddingLeft: '50px'}} className="img-responsive"/>
                            <div style={{paddingTop: '15px', paddingLeft: '50px'}}>
                                <h2>Aharan Manoharan</h2>
                                <h4>testemail@gmail.com</h4>
                            </div>
                        </Col>
                        <Col xs="6">
                            <img width="80%" style={{marginTop: '40px'}} src={'https://db-cdn.imgix.net/layout/image/Wl2rYyJ34r/4/screen.png'} className="img-responsive"/>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}
